from __future__ import annotations
from collections import Counter
from typing import Optional, List


class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        ch = Counter(s)
        for c in t:
            cnt = ch.get(c)
            if cnt is None:
                return c
            elif cnt <= 0:
                return c
            else:
                ch[c] = cnt - 1

        return ""


def main():
    inputs = [
        ("abcd", "abcde"),
        ("", "y"),
        (
            "",
            "",
        ),
    ]

    for s, t in inputs:
        solution = Solution()
        result = solution.findTheDifference(s, t)
        print(result)


if __name__ == "__main__":
    main()
